#### Landlord may apply to Supreme Court

**18**   (1) In case a tenant, after the lease or right of occupation, whether created in writing or verbally, has expired, or been determined, either by the landlord or by the tenant, by a notice to quit or notice under the lease or agreement, or has been determined by any other act whereby a tenancy or right of occupancy may be determined or put an end to, wrongfully refuses, on written demand, to go out of possession of the leased land, or the land that the tenant has been permitted to occupy, the landlord may apply to the Supreme Court

(a) setting out in an affidavit the terms of the lease or right of occupation, if verbal;

(b) annexing a copy of the instrument creating or containing the lease or right of occupation, if in writing;

(c) if a copy cannot be annexed by reason of it being mislaid, lost or destroyed, or of being in possession of the tenant, or from any other cause, then annexing a statement setting forth the terms of the lease or occupation, and the reason why a copy cannot be annexed;

(d) annexing a copy of the demand made for delivering possession, stating the refusal of the tenant to go out of possession, and the reasons given for the refusal, if any; and

(e) any explanation in regard to the refusal.

(2) This section extends and shall be construed to apply to tenancies from week to week, from month to month, from year to year, and tenancies at will, as well as to all other terms, tenancies, holdings or occupations.

(3) An application under subsection (1) shall be commenced at a registry of the Supreme Court located in the judicial district where the land is situated.
